import React from 'react';

export const Cards = ({ cards }) => {
  const { cards: id, title, description, thumbnail } = props;
  return cards.map((card) => {
    <article key={id} className='card'>
      <h2>{title}</h2>
      <p>{description}</p>
      <img src={thumbnail} alt={title} />
    </article>;
  });
};

export default Cards;
